import React from 'react';

const Index = () => {
    return (
        <div>
            <div className='bg-gray-200 py-4'>
                <h1>
                    <img className='h-24 mx-auto' src='/logo.png' alt='My Daily Status' title='My Daily Status' />
                </h1>
            </div>
        </div>
    )
}

export default Index;
